typedef long long llt;



const int MaxN = 16;



int N, fullSub;

int Log[1 << MaxN];

llt A[MaxN][MaxN];

llt dp[1 << MaxN];



void init() {

  scanf("%d", &N); fullSub = (1 << N) - 1;

  for (int i = 0; i < N; ++i) for (int j = 0; j < N; ++j)

    scanf("%lld", &A[i][j]);



  for (int i = 2; i < (1 << N); ++i)

    Log[i] = Log[i >> 1] + 1;

}



inline llt Calc_sum(int S) {

  int st[MaxN], tp = 0;

  llt res = 0;



  while (S > 0) {

    st[tp++] = Log[S & -S];

    S -= S & -S;

  }



  for (int i = 0; i < tp - 1; ++i) for (int j = i + 1; j < tp; ++j)

    res += A[st[i]][st[j]];

  return res;

}



void solve() {

  memset(dp, 0x80, sizeof dp); dp[0] = 0;

  for (int S = 0; S < (1 << N); ++S) {

    int Q = fullSub - S;

    for(int T = Q; T &= Q; --T)

      dp[S | T] = max(dp[S | T], dp[S] + Calc_sum(T));

  }



  printf("%lld\n", dp[(1 << N) - 1]);

}



int main() {

  init();

  solve();

  return 0;

