#include <cstring>

using namespace std;

typedef long long ll;

ll ans;

int n,val[100005],c[100005],pre[100005];

void merge(int a[],int l,int r){

    if(l==r)

        return;

    int mid = (l+r)/2;

    merge(a,l,mid);

    merge(a,mid+1,r);

    int i=l,j=mid+1,index=l;

    while (i<=mid&&j<=r){

        if(a[i]>a[j]){

            c[index++]=a[j];

            ans+=mid-i+1;

            j++;

        } else{

            c[index++]=a[i];

            i++;

        }

    }

    while (i<=mid)

        c[index++]=a[i++];

    while (j<=r)

        c[index++]=a[j++];

    for(int i=l;i<=r;i++)

        a[i]=c[i];

}

bool check(int mid){

    //memset(pre,0, sizeof(pre));

    ans = 0;//逆序对的数量

    for(int i=1;i<=n;i++){

        if(val[i]<mid)

            pre[i]=pre[i-1]-1;

        else

            pre[i]=pre[i-1]+1;

        if(pre[i]<0)

            ans++;

    }

    merge(pre,1,n);

    ll all = 1ll*n*(n+1)/2;

    return all>=2*ans;

}

